  return (
    <section className={classes.wrapper}>
      <h1 className={classes.title}>Готель Панорама Маґура</h1>
      <h2 className={classes.subTitle}>Номер телефону:</h2>
      <a href="tel:+380 97 065 6767" className={classes.phoneCall}>
        +380 97 065 6767
      </a>
      <a
        className={classes.subTitle}
        href="https://www.instagram.com/panorama_magura/"
